import './App.css';

function App() {
  return (
    <div className="app">
      <header className="app-header">
        <h1>VideoPlayer</h1>
      </header>
      <main className="app-main">
        <div className="video-container">
          <p>Video player content will go here</p>
        </div>
      </main>
    </div>
  );
}

export default App;
